import React from "react";
import Newsletter from "../Newsletter/Newsletter";
import Envelople from "../../Assets/envelope.png";

import "./Footer.css";
const Footer = () => {
  const downloadButton = () => {
    return window.open(
      "https://drive.google.com/uc?export=download&id=1mVp-L8Gx3vyOY3phIgxNYKq4aXYI_vIY"
    );
  };
  return (
    <div className="footerContainer">
      <div class="newsContainer">
        <form class="card-content">
          <div class="cardContainer">
            <div class="image">
              <img src={Envelople} alt=""></img>
            </div>
            <h1>Stay Updated</h1>
            <p>
              Subscribe to our newsletter and be the first to learn about new
              features.
            </p>
          </div>
          <div class="form-input">
            <label for="email"></label>
            <input type="email" placeholder="example@gmail.com"></input>
            <button
              class="subscribe-btn"
              onClick={() => alert("a dummy, No mail spamming here.")}
            >
              Subscribe
            </button>
          </div>
        </form>
      </div>
      <p>You can check full Powerpoint project here:</p>
      <button className="projBtn" onClick={downloadButton}>
        Download Mockup Project
      </button>
    </div>
  );
};
export default Footer;
